    name: 'CTR (%)',
    selector: 'CTR',
    sortable: true,
    minWidth: '120px',
    right: true,
    style: {
      justifyContent: 'right'
  }
  },
  {
    name: 'Reach',
    selector: 'Reach',
    sortable: true,
    minWidth: '120px',
    ///right: true,
    right: true,
    style: {
      justifyContent: 'right'
  }
  }
]


export default ExpandableTable
